description:
Snuffbox is a dark comedy series starring and written by Matt Berry and Rich Fulcher. Both actors use their real names for their main characters. Berry plays a hangman (&quot;High Executioner to the King of England&quot;), and Fulcher his assistant. The majority of the programme is set in a &quot;gentlemen's club for hangmen&quot;, although the show is also interspersed with sequences of sketches, often featuring different characters.
